import './App.css';
import React  from "react";
import 'antd/dist/antd.css'
import './index.css'
import InputBox from './component/Input'
import {Button, PageHeader} from "antd";


function App() {
  return (
    <div className="App">
      <div>
          <PageHeader>Content Analyzer</PageHeader>
          <div>
              <InputBox/>
          </div>
          <div>
              <Button
                  type="primary"
                  size="large"
              >
                  Summarize
              </Button>
          </div>

      </div>


    </div>
  );
}

export default App;
